var textReplacer = {

    replaceTextInAllElements: function(selectedElements) {
		
		var parentThis = this;

        function replaceTextInFirstElement(firstElement) {
            parentThis.replaceTextInElement(firstElement, selectionBorders.startOffset);
        }

        function replaceTextInLastElement(lastElement) {
            parentThis.replaceTextInElement(lastElement, 0, selectionBorders.endLength);
        }

        function replaceTextInOnlyOneElement(oneElement) {
            parentThis.replaceTextInElement(oneElement, selectionBorders.startOffset, selectionBorders.endLength - selectionBorders.startOffset);
        }

        selectedElements = $(selectedElements);

        var countOfSelectedElements = selectedElements.size();

        console.log(countOfSelectedElements + " elements to replace");

        if (countOfSelectedElements == 0) {
            return;
        }

        //выбран единственный элемент
        if (countOfSelectedElements == 1) {
            replaceTextInOnlyOneElement($(selectedElements.get(0)));
            return;
        }

        for (var i = 1; i < countOfSelectedElements - 1; i++) {
            var currentElement = $(selectedElements.get(i));
            this.replaceTextInElement(currentElement);
        };

        //заменяем текст в первом элементе(допускается не полное выделене
        replaceTextInFirstElement($(selectedElements.get(0)));

        replaceTextInLastElement($(selectedElements.get(countOfSelectedElements - 1)));
    },

    replaceTextInElement: function(textElement, offset, length) {
        var html = textElement.html();
        var currentOffset = 0;
        if (offset !== undefined) {
            currentOffset = offset;
        }

        var currentLength = html.length - currentOffset;
        if (length !== undefined) {
            currentLength = length;
        }

        console.log("replace text");


        var notSelectedHtmlBegin = html.substring(0, currentOffset);
        var selectedHtml = html.substring(currentOffset, currentOffset + currentLength);
        var notSelectedHtmlEnd = html.substring(currentOffset + currentLength, html.length);

        console.log("offset:" + currentOffset);
        console.log("length:" + currentLength);
        console.log("html length:" + html.length);

        console.log("notSelectedHtmlBegin:" + notSelectedHtmlBegin);
        console.log("selected html:" + selectedHtml);
        console.log("notSelectedHtmlEnd:" + notSelectedHtmlEnd);
        console.log("html before replace:" + html);

        console.log("html what i use:" + notSelectedHtmlBegin + selectedHtml + notSelectedHtmlEnd);

        var selectedHtmlAfterReplace = this.replaceTextInHtml(selectedHtml);

        console.log("html after replace:" + notSelectedHtmlBegin + selectedHtmlAfterReplace + notSelectedHtmlEnd);

        textElement.html(notSelectedHtmlBegin + selectedHtmlAfterReplace + notSelectedHtmlEnd);

        console.log("really html after replace:" + textElement.html());
    },

    regexEncode: function(text) {
        return text.replace(/['`~!@#$%^&*()_|+-=?;:'",.<>\{\}\[\]\\\/]/g, "\\$&");
    },    

    replaceTextInHtml: function(html) {
        var spliters = [new RegExp("(<a.*</a>)","g"),new RegExp("(<div>)", "g"), new RegExp("(</div>)", "g"), new RegExp('(<div style="" class="" id="">)', "g"), new RegExp("(<br>)", "g"), new RegExp("(<br/>)", "g")];
        var splitedHtml = [];

        function splitString(string, splitters) {
            var list = [string];

            function traverseList(list, splitter, index) {
                if (list[index]) {
                    if ((list.constructor !== String) && (list[index].constructor === String))
                        (list[index] != list[index].split(splitter)) ? list[index] = list[index].split(splitter) : null;
                    (list[index].constructor === Array) ? traverseList(list[index], splitter, 0): null;
                    (list.constructor === Array) ? traverseList(list, splitter, index + 1): null;
                }
            }

            function flatten(arr) {
                return arr.reduce(function(acc, val) {
                    return acc.concat(val.constructor === Array ? flatten(val) : val);
                }, []);
            }


            for (var i = 0, len = splitters.length; i < len; i++) {
                traverseList(list, splitters[i], 0);
            }
            return flatten(list);
        };

        splitedHtml = splitString(html, spliters);

        splitedHtml = splitedHtml.filter(function(item) {
            if (item === "") {
                return false;
            }

            return true;
        });

        function isHtmlTag(text) {
            var status = false;
            spliters.forEach(function(entry) {
                if (entry.test(text)) {
                    status = true;
                }
            });
            return status;
        };

        console.log("splitedHtml:" + splitedHtml);

        splitedHtml = splitedHtml.map(function(entry) {
            if (isHtmlTag(entry)) {
                return entry;
            }

            console.log("change text:" + entry + " to " + htmlUtils.htmlEncode(layotChanger.changeLayot(htmlUtils.htmlDecode(entry))));

            return htmlUtils.htmlEncode(layotChanger.changeLayot(htmlUtils.htmlDecode(entry)));
        });


        return splitedHtml.join("");
    }
};

function replaceTextInPage() {
	
	selectionBorders.determineSelectionBorders();

    var selectedElements = selectionBorders.getSelectedElements();

    layotChanger.determineLayotFromElements(selectedElements, selectionBorders.startOffset, selectionBorders.endLength);

    textReplacer.replaceTextInAllElements(selectedElements);

}

